import React from 'react'

const Dashfilter = () => {
  return (
    <div className='dashfil'>
       <SearchBar onSearch={handleSearch} />
      <FilterOptions onFilter={handleFilter} />
      <EventList events={filteredEvents} />
    </div>
  )
}

export default Dashfilter
